import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./styles.scss";
import { connect } from "react-redux";

class Footer extends Component {
  renderIcon = (list) => {
    var result = null;

    result = list.map((item, index) => {
      return <Link to={item.to}>{item.item}</Link>;
    });

    return result;
  };

  renderSub = (list) => {
    var result = null;

    result = list.map((item, index) => {
      return (
        <li className="nav-item">
          <Link to={item.to} className="nav-link ps-0 size-14 ">
            {item.label}
          </Link>
        </li>
      );
    });
    return result;
  };

  renderList = (nav) => {
    var result = null;

    result = nav.map((item, index) => {
      return (
        <div className="col">
          <div className="h5 text-white text-start">{item.navItem}</div>
          <ul className="nav flex-column justify-content-center">
            {this.renderSub(item.list)}
          </ul>
        </div>
      );
    });

    return result;
  };

  render() {
    var { nav } = this.props;
    return (
      <div className="container-fluid py-4 pb-3" id="footer-home">
        <div className="container">
          <div className="row">
            <div className="col-12 text-center">
              <img
                src="https://www.aorus.com/assets/img/logo_svg.2fc451ee.svg"
                alt=""
              />
            </div>
            <div className="col-12 my-3 size-18 text-white text-center">
              TEAM UP. FIGHT ON.
            </div>
            <div className="col-12 text-center">
              {this.renderIcon(listIcon)}
            </div>
          </div>
          <div className="row list-nav row-cols-4 mt-5 px-5 ">
            <div className="col">
              <div className="h5 text-white text-start">ABOUT US</div>
              <ul className="nav justify-content-start">
                <li className="nav-item">
                  <Link to="/" className="nav-link ps-0 size-14">
                    About AROUS
                  </Link>
                  <Link to="/" className="nav-link ps-0 size-14">
                    About GIGABYTE
                  </Link>
                </li>
              </ul>
            </div>
            {this.renderList(nav)}
          </div>
        </div>
      </div>
    );
  }
}

const listIcon = [
  {
    to: "/",
    item: <i className=" fab fa-facebook-f" />,
  },
  {
    to: "/",

    item: <i className="fab fa-twitter" />,
  },
  {
    to: "/",

    item: <i className="fab fa-youtube" />,
  },
  {
    to: "/",

    item: <i className="fab fa-instagram" />,
  },
];

const mapStateToProps = (state) => {
  return {
    nav: state.navItem,
  };
};

export default connect(mapStateToProps, null)(Footer);
